import React from 'react';
import { useNavigate } from 'react-router-dom';
import './LandingPage.css';

const LandingPage = () => {
  const navigate = useNavigate();

  const handleSignUp = () => {
    navigate('/signup');
  };

  const handleLogin = () => {
    navigate('/login');
  };

  return (
    <div className="landing-wrapper">
      <div className="landing-content">
        <h1 className="landing-title">Welcome to CookSphere</h1>
        <p className="landing-subtitle">A Place to Share Your Culinary Passion</p>
        <div className="landing-buttons">
          <button className="landing-btn signup" onClick={handleSignUp}>
            Sign Up
          </button>
          <button className="landing-btn login" onClick={handleLogin}>
            Log In
          </button>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
